            "只有在这儿，您可以似亿万富豪般地轻松消费来自意大利的奢侈品，而无关您的收入与地位！\n\n亲爱的访客，\n\n探索来自意大利、法国超过200个才华横溢的设计师品牌的精致系列。在Vetrina Mia（福催拿），我们独家将这些独特和奢华的创作带到亚太市场，包括中国。\n\n每个品牌的所有时尚产品均由经验丰富的意大利工匠精心制作，他们的家族几代都是为全球顶级奢侈品牌制造高端产品。\n\n我们相信时尚是精美设计和精心制作的艺术创作,是人类智慧的证明，每个人都有权力享受而无关他的收入和社会地位。\n\n展示间：\n\n• 地点：中国上海市长宁区凯旋路1398号长宁国际商场T6-105号店铺\n\n8月1日起，您将能够注册并指出您感兴趣的产品，无需预付款即可排队购买。\n\n9月1日起，我们将启动在线零售，所有销售都将通过我们的平台和移动应用程序进行。\n\n由于工匠的精细制作过程漫长，可能会出现延迟，甚至买不到的状况，对此我们深表歉意。您能做的就是尽早排队如果您不想等待，可以随时取消订单，我们秉持先着顺的原则。\n\n购买条件：\n\n品牌会员资格：每个品牌都有其独立的会员资格。\n\n免费试用： 在每个品牌首次购买后的前三个月内，会员资格免费。\n\n会员优惠： 非会员与会员在价格和服务上有所不同。成为会员后，将享受打至少六折优惠价。初期我们先推出包包系列，之后将陆续推出服饰、鞋子、童装等。\n\n赞助费用： 从首次购买后的三个月后起，您将自动成为正式会员。每个品牌会请求每月10元人民币的赞助费，相当于一杯咖啡的费用。当然，您也可以选择支付更高金额以支持您喜爱的品牌及其运营。\n\n灵活的会员制度： 会员费用每3个月收取一次，但您可以随时无条件取消会员资格。我们保留拒绝再次加入的权利。\n\n我们非常感谢您在我们启动期间对我们的理解和耐心，这段时间我们可能会遇到一些服务差错或问题，我们将努力为您带来多样和迷人的时尚体验，以及温暖周到的服务。\n\n每一个会员永远是福催拿家庭的一员，您的想法和意见永远是我们改进的目标与动力。"),
